import {useState} from 'react'
import { Cookies, useCookies } from 'react-cookie'
import {useNavigate} from 'react-router-dom'
import axios from 'axios'
import React from 'react'
import Nav from '../components/Navigation/Navigation'

const NewUsers = () => {

    // The code defines a state variable for a user's data, including their id, first name, date of birth, URL, 
    // and a list of matches. It also defines functions for setting and removing cookies.
    const [cookies, setCookie, removeCookie] = useCookies(null)
    const [userData, setFormData] = useState({
        user_id: cookies.UserId,
        First_Name: "",
        dob_day: "",
        dob_month: "",
        dob_year: "",
        url: "",
        about: "",
        matches: []
    })


    // The code below submits a form to a server. It uses the useNavigate hook from React Router to navigate to the 
    // '/dashboard' route if the form is submitted successfully.
    let navigate = useNavigate()

    const handleSubmit = async (e) => {
        console.log('submitted')
        e.preventDefault()
        try {
            const response = await axios.put('http://localhost:8888/user', {userData})
            console.log(response)
            const success = response.status === 200
            if (success) navigate('/dashboard')
        } catch (err) {
            console.log(err)
        }

    }

    // The code below sets up a handleChange function to be used on a form. It uses a ternary operator to check the type of input, 
    // whether it is a checkbox or not. If it is a checkbox, it returns the value as checked, if not, it returns the value as is. 
    // It then sets the name of the input to whatever was entered into the form.
    const handleChange = (e) => {
        console.log('e', e)
        const value = e.target.type === "checkbox" ? e.target.checked : e.target.value
        const name = e.target.name

        setFormData((prevState) => ({
            ...prevState,
            [name]: value
        }))
    }


    // The code above renders a form for a user to fill out to create an account. The form includes input fields for the user's 
    // first name, birthday, gender, gender preference, and a short description about themselves. There is also an input field for 
    // the user to submit a URL for a profile photo.
    return (
        <>
            <Nav
                setShowPopup={() => {
                }}
                showPopup={false}
            />

            <div className="verification">
                <h2>CREATE ACCOUNT</h2>

                <form onSubmit={handleSubmit}>
                    <section>
                        <label htmlFor="first_name">First Name</label>
                        <input
                            id="First_Name"
                            type='text'
                            name="First_Name"
                            placeholder="First Name"
                            required={true}
                            value={userData.First_Name}
                            onChange={handleChange}
                        />

                        <label>Birthday</label>
                        <div className="multiple_container">
                            <input
                                id="dob_day"
                                type="number"
                                name="dob_day"
                                placeholder="DD"
                                required={true}
                                value={userData.dob_day}
                                onChange={handleChange}
                            />

                            <input
                                id="dob_month"
                                type="number"
                                name="dob_month"
                                placeholder="MM"
                                required={true}
                                value={userData.dob_month}
                                onChange={handleChange}
                            />

                            <input
                                id="dob_year"
                                type="number"
                                name="dob_year"
                                placeholder="YYYY"
                                required={true}
                                value={userData.dob_year}
                                onChange={handleChange}
                            />
                        </div>

                        <label>Gender</label>
                        <div className="multiple_container">
                            <input
                                id="man-gender-identity"
                                type="radio"
                                name="gender_identity"
                                value="man"
                                onChange={handleChange}
                                checked={userData.gender_identity === "man"}
                            />
                            <label htmlFor="man-gender-identity">Boy</label>
                            <input
                                id="woman-gender-identity"
                                type="radio"
                                name="gender_identity"
                                value="woman"
                                onChange={handleChange}
                                checked={userData.gender_identity === "woman"}
                            />
                            <label htmlFor="woman-gender-identity">Girl</label>
                            <input
                                id="more-gender-identity"
                                type="radio"
                                name="gender_identity"
                                value="more"
                                onChange={handleChange}
                                checked={userData.gender_identity === "more"}
                            />
                        </div>


                        <label>Show Me</label>

                        <div className="multiple_container">
                            <input
                                id="man-gender-interest"
                                type="radio"
                                name="gender_interest"
                                value="man"
                                onChange={handleChange}
                                checked={userData.gender_interest === "man"}
                            />
                            <label htmlFor="man-gender-interest">Boys</label>
                            <input
                                id="woman-gender-interest"
                                type="radio"
                                name="gender_interest"
                                value="woman"
                                onChange={handleChange}
                                checked={userData.gender_interest === "woman"}
                            />
                            <label htmlFor="woman-gender-interest">Girls</label>
                        </div>

                        <label htmlFor="about">About</label>
                        <input
                            id="about"
                            type="text"
                            name="about"
                            required={true}
                            placeholder="Help me find my furever home..."
                            value={userData.about}
                            onChange={handleChange}
                        />

                        <input type="submit"/>
                    </section>

                    <section>

                        <label htmlFor="url">Profile Photo</label>
                        <input
                            type="url"
                            name="url"
                            id="url"
                            onChange={handleChange}
                            required={true}
                        />
                        <div className="photo-container">
                            {userData.url && <img src={userData.url} alt="profile pic preview"/>}
                        </div>


                    </section>

                </form>
            </div>
        </>
    )
}
export default NewUsers
